  false,\n\t\"url\": null,\n\t\"notes\": \"This report analyzed and summarized the
  forest of the Great Dismal Swamp in 1974 for purposes of commercial use. Aerial
  photography, both black and white and modified color, was obtained of the swamp.
  Representative stands were selected throughout the study area and these stands were
  visited on the ground for ascertainment of species composition, size class and stand
  density. The forest type map was then prepared using special 1:24,000 black and
  white photography and ground checks. The various forest types were delineated according
  to species, size class and density. Acreages for each type were determined and summarized.\",\n\t\"owner_org\":
